DROP TABLE IF EXISTS `pegawai_kp`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `pegawai_kp` (
  `id_kp` bigint(20) NOT NULL AUTO_INCREMENT,
  `nip` varchar(18) NOT NULL,
  `gol` int(2) NOT NULL,
  `no_sk` varchar(50) NOT NULL,
  `tgl_sk` date NOT NULL,
  `tmt_gol` date NOT NULL,
  `no_bkn` varchar(50) NOT NULL,
  `tgl_bkn` date NOT NULL,
  `jenis_kp` int(3) NOT NULL,
  PRIMARY KEY (`id_kp`),
  KEY `gol` (`gol`),
  KEY `jenis` (`jenis_kp`),
  KEY `nip` (`nip`),
  CONSTRAINT `gol` FOREIGN KEY (`gol`) REFERENCES `pegawai_golongan` (`id_golongan`) ON UPDATE CASCADE,
  CONSTRAINT `jenis` FOREIGN KEY (`jenis_kp`) REFERENCES `pegawai_kp_jenis` (`kode_jenis`) ON UPDATE CASCADE,
  CONSTRAINT `nip` FOREIGN KEY (`nip`) REFERENCES `pegawai_pegawai` (`nip`) ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=220 DEFAULT CHARSET=latin1;
